import { useState } from 'react';
import { useNavigate } from 'react-router-dom'
import './App.css'
import Axios from 'axios';

const api_url = "http://localhost:38080/"
var datap 



async function getapi(api_url){
    const response = await fetch(api_url)
    var data = await response.json()
    showdata(data)  
}

function showdata(data){
    console.log(data.data)
    datap = data.username
}

getapi(api_url)

function Login() {
    let navigate = useNavigate()

function Apps(){
    const [usernameReg, setUsernameReg] = useState("");
    const [passwordReg, setPasswordReg] = useState("");

    const register = () =>{
        Axios.postuser("http://localhost:38080/",{
            username: usernameReg,
            password: passwordReg
        }).then((response)=>{
            console.log(response)
        })
    }
}

return (

    <div className='body1'>
        <h1 className='header'>Login</h1>
        <br></br>
        <input type={"text"}  placeholder="enter text" onChange={(e)=>{setUsernameReg(e.target.value)}} ></input><br></br><br></br>
        <input type={"text"}  placeholder="enter text"></input><br></br><br></br>
        <button onClick={() => navigate('/Main')}>เข้าสู่ระบบ</button><br></br><br></br>
        <button className='card' onClick={(register)}>register</button>
        {/* <p>{{datap}}</p>  */}
    </div>
    
);
}

export default Login;
